import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container : {
        flex: 1,
    },

    inputText: {
        border: "1px solid #000",
        fontFamily: "helvetica",
        height: 30,
        textAlign: "center",
        margin: 5,
        borderRadius: 5,
        fontStyle: "italic"

    }
});
